import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { StyleSheet, View } from 'react-native';
import { 
  Provider as PaperProvider,
  DarkTheme,
  Appbar,
  Text
} from 'react-native-paper';
import CelebrityCard from "./components/CelebrityCard.js";
const trumpImage = require('./assets/trump_512x512.png');

export default function App() {
  return ( 
    <PaperProvider theme={DarkTheme}>
      <Appbar.Header>
        <Appbar.Content title="Select a Voice"/>
      </Appbar.Header>
      <View style={styles.container}>
        <View style={classes.celebrityCardWrapper}>
          <CelebrityCard name="Donald Trump" image={trumpImage}/>
        </View>
        <StatusBar style="auto" />
      </View>
    </PaperProvider>
  );
}

const styles = StyleSheet.create({
  container: { 
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
    backgroundColor: "#121212",
    minHeight: 100
  },
  celebrityCardWrapper: {
    padding: 16
  }
});
